//     date: "2020-12-31T00:00:00.000Z",
//     observations: "Who knows.",
//     creationDate: "2020-12-29T17:36:04.933Z",
//   },
// ];

const columns = [
  {
    id: "name",
    label: "Name",
  },
  {
    id: "email",
    label: "Email",
  },
  {
    id: "date",
    label: "Date",
  },
  {
    id: "observations",
    label: "Observations",
  },
  {
    id: "creationDate",
    label: "Creation Date",
  },
];

class QuestionList extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      questionList: [],
    };
  }

  componentDidMount() {
    fetch(process.env.SERVER_URL)
      .then((res) => res.json())
      .then((result) => {
        this.setState({ questionList: result });
      });
  }

  componentWillUnmount() {
    this.setState({ questionList: [] });
  }

  render() {
    const questionList = this.state.questionList;

    console.log("Questions: ", questionList);

    return <ScrollableTable columns={columns} rows={questionList} />;
  }
}

export default QuestionList;
